import { FaShoppingCart } from "react-icons/fa";
import { NavLink } from "react-router-dom";



const Navbar = () => {
  return(
    <div>
      <div className="flex flex-row justify-between">
          <NavLink to='/'>
            <div>
              <img src="https://logos-world.net/wp-content/uploads/2020/04/Adidas-Logo-1991-present.jpg " className="w-12 h-13 "/>  
            </div>
          </NavLink>

          <div>
            <NavLink to='/'>
             <p>Home</p>
            </NavLink>
            
            <NavLink to='/cart'>
              <div>
                <FaShoppingCart/>
              </div>

            </NavLink>
            
          </div>
      </div>

    </div>
  )
};

export default Navbar;
